import React from 'react'

import Button from '@material-ui/core/Button';
const Index = (props) => {
    return <Button onClick={props.onClick} disabled={props.disabled ? "disabled" : ""} type="submit" className={props.className}>{props.text}</Button>
}

export default Index;
